data.Caption:
📌یه سری نکات استایل هستش که هر خانمی باید بلد باشه😍توی کپشن کامل توضیح دادم🥰❤🌹
.
.
@iris.dress.ir
@iris.dress.ir
@iris.dress.ir 

1.بدانید که سایز ما فقط یک عدد است و روی تناسب لباس تاکید داشته باشید.😘
یعنی ممکن است که سایز شما small باشد اما یک لباس medium برای شما مناسب تر باشد.

2.همیشه روی لباس سیاه سرمایه گذاری کنید.🤗
زمانی که حوصله ندارید که ست های رنگی ایجاد کنید یا حتی زمان ندارید که این کار را انجام دهید سیاه بهترین گزینه است.

3.کمد خود را ساده نگه دارید.😍
زمانی که لباس های ساده تر و در توناژ های رنگی ثابت داشته باشید برای ست کردن بسیار راحت ترید و به این صورت هزینه کمتری صرف خرید لباس خواهید کرد.
.
@iris.dress.ir
@iris.dress.ir
@iris.dress.ir
.
4.روسری روشن می تواند چهره ی شما را بسیار تغییر دهد.🥳
به خاطر همین همیشه یکی دو تا روسری روشن و جذاب داشته باشید.

5.اگر می خواهید پاهای شما بلندتر دیده شوند رنگ کفش و شلوار یکسان انتخاب کنید.👠
این گونه خطای دید ایجاد می شود که پاهای بلندتری دارید.

6.رنگ رژ لب های مختلف را تست کنید. یک رژ لب زیبا می تواند کل استایل شما را تحت تاثیر قرار دهد.💄
.
@iris.dress.ir
@iris.dress.ir
@iris.dress.ir
.

7.قطعا اندام ها متفاوت هستند و ممکن است لباس هایی که می خریم در برخی نقاط نیاز به اصلاح داشته باشند پس همیشه یک خیاط خوب لازم است.👗

8.لایه ای پوشیدن را در هیچ فصلی فراموش نکنید.
لایه ای پوشیدن استایل شما را پیچیده و جذاب تر می کند.🧣

9.وقتی چیزی را بخرید که مطمئن باشید می توانید چندین بار و در شیوه های مختلف از آن استفاده کنید.😍😍😍😍😍😍

 

10.رنگ های مختلف بپوشید. هر رنگی می تواند حالت و روحیه ی شما را تکان دهد.
از رنگ های پرانرژی و شاد بیشتر استفاده کنید.
.
@iris.dress.ir
@iris.dress.ir
@iris.dress.ir
.
11.از دستمال سرهای بامزه غافل نشوید. آنها می توانند شما را بسیار بانمک کنند.

 
12.هیچ زمان نقش اکسسوری را دست کم نگیرید.
از زیورآلات تا کیف دستی هر کدام به تنهایی می تواند شما را خیلی شیک کنند.

13.ترکیب کردن الگوهای مختلف را امتحان کنید گاهی اوقات به استایل های جالبی می رسیم.
.
